import React from "react";
import "./card-list.style.css";

const CardList = props => {
  return (
    <div className="card-list">
      {this.state.monsters.map(monster => (
        <div className="card-component" key={monster.id}>
          {monster.name}
        </div>
      ))}
    </div>
  );
};

export default CardList;
